For the purposes of KRS 194A.450 to 194A.458:
"Controlled substance" has the same meaning as in KRS 218A.010;
"Dispense" has the same meaning as in KRS 217.015;
"Health care provider" has the same meaning as in KRS 304.17A-005;
"Health facility" has the same meaning as in KRS 216B.015;
"Legend drug" has the same meaning as in KRS 217.015;
"Pharmacist" has the same meaning as in KRS 315.010; and
"Prescription drug" has the same meaning as in KRS 315.010.
